// import ProductsList from '../ProductsList/ProductsList';
import { useState, useEffect } from 'react';
function Clothing({ items }) {
  console.log(items)
  if (items.length <= 0) {
    return "loading..."
  }
  //if clothing is equal to category. create a div with the following images, price. and title
  const apparel = items.filter((item)=>{
    return(
      (item.category === "men's clothing") ||(item.category === "women's clothing")
    )}
  )
  console.log(apparel);

  return (
      <div className="clothing-list">
        <h1>This is the clothing</h1>
        <div className="Clothing">
                {apparel && items.map((item, id)=>{
                    if(item.category ==="clothing"){
                      console.log(item.category)
                    return(
                        <div className="clothes" key={id}>
                            <img src={item.image}/>
                            <h1>{item.price}</h1>
                            <h3>{item.title}</h3>
                            <h4>{item.category}</h4>
                        </div>
                    )}
                })}  
           </div>  
      </div>
    );
  }
  export default Clothing;
